let door = parcel.getFeatureByUuid('bffbc599-3fed-4b59-9ea9-6b5434f17754')//门uuid
let outsideSwitch = parcel.getFeatureByUuid('da504ea0-bfec-4f82-98ed-4a76449c16e2')//外开关
let insideSwitch = parcel.getFeatureByUuid('b8ea59b2-1bde-416d-a102-49668418a22c')//内开关


feature.on('click',e=>{
  //your code here
    //复位
    outsideSwitch.set({position:[4.96,1.85,9.75]})
    insideSwitch.set({position:[4.8,1.85,9.05]})
    door.set({position:[3.7,0.75,9.52]})
    door.set({rotation:[0,-Math.PI,0]})    

    //动画变量声明
    let outsideSwitch_active = outsideSwitch.createAnimation('position')//外开关隐藏动画
    let insideSwitch_active = insideSwitch.createAnimation('position')//内开关隐藏动画
    let door_move = door.createAnimation('position')//位置动画
    let door_rotate = door.createAnimation('rotation')//旋转动画
    let door_in = door.createAnimation('position')//收门动画

    //隐藏开关
    outsideSwitch_active.setKeys([{
        frame:2,
        value:outsideSwitch.position.add(new Vector3(0,0,-0.06))    
     }])
    insideSwitch_active.setKeys([{
        frame:2,
        value:insideSwitch.position.add(new Vector3(0.06,0,0))  
     }])

    outsideSwitch.startAnimations([outsideSwitch_active])
    insideSwitch.startAnimations([insideSwitch_active])
    outsideSwitch.set({position:[4.96,1.85,9.69]})
    insideSwitch.set({position:[4.86,1.85,9.05]})

    //门动画配置
    door_move.setKeys([{
      frame: 60,
      value: door.position.add(new Vector3(0.9,0,-0.12))
    }])

    door_rotate.setKeys([{
        frame: 40,
        value: door.rotation.add(new Vector3(0,Math.PI/2, 0))
      }])

    door.startAnimations( [door_move,door_rotate] ) //Starts the animation
    door.set({position:[4.6,0.75,9.4]})
    door.set({rotation:[0,-Math.PI/2,0]})

    setTimeout(function() {
       //收门
      door_in.setKeys([{
        frame: 50,
        value: door.position.add(new Vector3(0,0,-0.7))
      }])

      door.startAnimations([door_in])
      door.set({position:[4.6,0.75,8.7]})
    },2500)

    //延迟十秒后复原
    setTimeout(function (){
      //推出门  
      door_in.setKeys([{
        frame: 50,
        value: door.position.add(new Vector3(0,0,0.7))
      }])

      door.startAnimations([door_in])
      door.set({position:[4.6,0.75,9.4]})

      setTimeout(function() {
        //旋转、移动  
        door_move.setKeys([{
          frame: 40,
          value: door.position.add(new Vector3(-0.9,0,0.12))
        }])

        door_rotate.setKeys([{
          frame: 60,
          value: door.rotation.add(new Vector3(0,-Math.PI/2, 0))
        }])

        door.startAnimations( [door_move,door_rotate] )  

        door.set({position:[3.7,0.75,9.52]})
        door.set({rotation:[0,-Math.PI,0]})    

        setTimeout(function() {
          //显示开关
          outsideSwitch_active.setKeys([{
              frame:2,
              value:outsideSwitch.position.add(new Vector3(0,0,0.06))    
           }])
          insideSwitch_active.setKeys([{
              frame:2,
              value:insideSwitch.position.add(new Vector3(-0.06,0,0))  
           }])     

          outsideSwitch.startAnimations([outsideSwitch_active])
          insideSwitch.startAnimations([insideSwitch_active])    

          outsideSwitch.set({position:[4.96,1.85,9.75]})
          insideSwitch.set({position:[4.8,1.85,9.05]})        
        },2000)         
      },2000)  
    },10000)
})

